description:
Bán toà nhà 10 tầng mặt ngõ 52 Tô Ngọc Vân, Quảng An, Tây Hồ, Hà Nội.
- Sổ đỏ 210m2, mặt tiền 9m, nở hậu đẹp;
- Vị trí mặt ngõ to như mặt phố, vỉa hè rộng rãi.
- Phố tập trung của nhiều nhà hàng, toà căn hộ cao cấp, khu văn phòng của cộng đồng người nước ngoài sinh sống;
- Phố kinh doanh sầm uất tấp nập, vị trí đẹp nhất phố Tô Ngọc Vân;
- Nhà 2 mặt thoáng, view nhìn hồ Tây rất thoáng và nhiều ánh sáng.
- Nhà thiết kế hiện đại, tầng 1 mặt bằng kinh doanh, các tầng tiếp theo cho thuê căn hộ dịch vụ;
- Hiện tại chủ vẫn đang kinh doanh rất tốt, có dòng tiền ổn định hàng tháng.
- Khách mua về cứ thế là khai thác cho thuê, có tiền hàng tháng luôn.
- Sổ đỏ đẹp nhà nở hậu.
- Giá bán 98 tỷ.
- Nguyễn Đức Tài: ( Miễn trung Gian )
